WITH filtered_date AS (SELECT d_date_sk, d_date FROM date_dim WHERE d_month_seq BETWEEN 1194 AND 1194 + 11), filtered_customer AS (SELECT c_customer_sk, c_last_name, c_first_name FROM customer WHERE c_birth_year BETWEEN 1943 AND 1949), store_sales_data AS (SELECT DISTINCT c_last_name, c_first_name, d_date FROM store_sales JOIN filtered_date ON store_sales.ss_sold_date_sk = filtered_date.d_date_sk JOIN filtered_customer ON store_sales.ss_customer_sk = filtered_customer.c_customer_sk WHERE ss_list_price BETWEEN 217 AND 246 AND ss_wholesale_cost BETWEEN 34 AND 44), catalog_sales_data AS (SELECT DISTINCT c_last_name, c_first_name, d_date FROM catalog_sales JOIN filtered_date ON catalog_sales.cs_sold_date_sk = filtered_date.d_date_sk JOIN filtered_customer ON catalog_sales.cs_bill_customer_sk = filtered_customer.c_customer_sk WHERE cs_list_price BETWEEN 217 AND 246 AND cs_wholesale_cost BETWEEN 34 AND 44), web_sales_data AS (SELECT DISTINCT c_last_name, c_first_name, d_date FROM web_sales JOIN filtered_date ON web_sales.ws_sold_date_sk = filtered_date.d_date_sk JOIN filtered_customer ON web_sales.ws_bill_customer_sk = filtered_customer.c_customer_sk WHERE ws_list_price BETWEEN 217 AND 246 AND ws_wholesale_cost BETWEEN 34 AND 44) SELECT COUNT(*) FROM ((SELECT * FROM store_sales_data) EXCEPT (SELECT * FROM catalog_sales_data) EXCEPT (SELECT * FROM web_sales_data)) AS cool_cust